import React, { useState } from 'react';
import { Dialog } from '@headlessui/react';
import gear from '../assets/visual.png';
import Logo from '../assets/Logo.png';

const Header = () => {
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  const navItems = [
    { label: 'About', href: '#about' },
    { label: 'Features', href: '#features' },
    { label: 'Customers', href: '#customers' },
    { label: 'Updates', href: '#updates' },
    { label: 'Help', href: '#help' }
  ]

  return (
    <div className="min-h-screen">
      {/* Header - Fixed height of 87px */}
      <header className="absolute w-full top-0 z-50 h-[87px]" style={{backgroundColor:'rgba(234, 238, 254, 1)', boxShadow:'none'}}>
        <nav className="flex items-center justify-between px-4 py-4 lg:px-8 h-full">
          <div className="flex items-center">
            <div className="text-2xl font-bold flex items-center">
              <img src={Logo} alt="Logo" className="h-8 w-auto mr-2" />
            </div>
          </div>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8" style={{fontWeight:'400',lineHeight:'23px',color:'rgba(0, 0, 0, 0.6)'}}>
            {navItems.map((item) => (
              <a 
                key={item.label} 
                href={item.href}
                className="text-gray-600 hover:text-gray-900"
              >
                {item.label}
              </a>
            ))}
            <button className="bg-black text-white px-4 py-2 rounded-lg">
              Get for free
            </button>
          </div>

          {/* Mobile Menu Button */}
          <button 
            className="md:hidden"
            onClick={() => setMobileMenuOpen(true)}
          >
            <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16m-7 6h7" />
            </svg>
          </button>
        </nav>

        {/* Mobile Menu */}
        <Dialog 
          open={mobileMenuOpen} 
          onClose={() => setMobileMenuOpen(false)}
          className="relative z-50 md:hidden"
        >
          <div className="fixed inset-0 bg-black/20" aria-hidden="true" />
          <div className="fixed inset-y-0 right-0 w-full bg-white p-6 sm:max-w-sm">
            <div className="flex justify-between items-center">
              <div className="text-2xl font-bold">joyful</div>
              <button onClick={() => setMobileMenuOpen(false)}>
                <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                </svg>
              </button>
            </div>
            <div className="mt-6">
              {navItems.map((item) => (
                <a
                  key={item.label}
                  href={item.href}
                  className="block py-3 text-gray-600 hover:text-gray-900"
                >
                  {item.label}
                </a>
              ))}
            </div>
          </div>
        </Dialog>
      </header>

      {/* Hero Section */}
      <main className="relative pt-[87px]">
        <div className="min-h-[calc(100vh-87px)]" style={{background: 'linear-gradient(201.28deg, #EAEEFE 45.21%, #183EC2 97.31%)'}}>
          <div className="container mx-auto px-4 py-12 md:py-24">
            <div className="flex flex-col md:flex-row items-center">
              {/* Content */}
              <div className="w-full md:w-1/2 text-left">
                <p className="text-sm mb-4 px-4 py-1 rounded-lg border border-black text-black text-center" style={{width: 'fit-content'}}>Version 2.0 is here</p>
                <h1 className="text-5xl md:text-6xl font-bold mb-6">
                  Pathway to productivity
                </h1>
                <p className="text-lg md:text-xl mb-8 text-gray-700 max-w-xl">
                  Celebrate the joy of accomplishment with an app designed to track your progress, motivate your efforts, and celebrate your successes.
                </p>
                <div className="flex space-x-4">
                  <button className="bg-black text-white px-6 py-3 rounded-lg">
                    Get for free
                  </button>
                </div>
              </div>

              {/* Image */}
              <div className="w-full md:w-1/2 mt-12 md:mt-0">
                <div className="relative w-full max-w-[511px] mx-auto aspect-[511/448]">
                  <img 
                    src={gear}
                    alt="Productivity visualization"
                    className="w-full h-full object-contain"
                  />
                </div>
              </div>
            </div>

            {/* Partner Logos Section with Infinite Scroll */}
            <div className="h-[132px] bg-white relative overflow-hidden">
              <div className="absolute w-full h-full flex items-center">
                {/* Gradient Overlay for fade effect */}
                <div className="absolute left-0 w-32 h-full bg-gradient-to-r from-white to-transparent z-10"></div>
                <div className="absolute right-0 w-32 h-full bg-gradient-to-l from-white to-transparent z-10"></div>

                {/* Scrolling container */}
                <div className="flex animate-scroll whitespace-nowrap">
                  {partners.map((partner, index) => (
                    <div
                      key={`${partner}-${index}`}
                      className="flex items-center justify-center mx-12 min-w-[120px]"
                    >
                      <img
                        src="/api/placeholder/120/40"
                        alt={partner}
                        className="h-8 w-auto opacity-50"
                      />
                    </div>
                  ))}
                </div>
              </div>
            </div>
          </div>
        </div>
      </main>

      <style jsx>{`
        @keyframes scroll {
          0% {
            transform: translateX(0);
          }
          100% {
            transform: translateX(-50%);
          }
        }

        .animate-scroll {
          animation: scroll 20s linear infinite;
        }
      `}</style>
    </div>
  );
};

export default Header;
